import * as React from "react";
import { AppData } from "./appdata";
import Skills from "./skills";
import Recommendations from "./recommendations";
import Interests from "./interests";
import Doodles from "./doodles";

const Aside = () => {
  let { state, dispatch } = React.useContext(AppData);
  return (
    <React.Fragment>
      <aside>
        {/*
      <Skills />
      <Recommendations />
      <Interests />

      */}
        <section className="res-skills res-editable" id="Skills">
          <h2 className="taped-b rr poly-wrap">Skills</h2>
          <ul className=""></ul>
        </section>

        <section className="res-blurbs res-editable auto-slides" id="Blurbs">
          <h2 className="note rr poly-wrap">Recommendations</h2>
          <ul className="add-tack"></ul>
        </section>

        <section className="res-editable res-interests rr" id="Interests">
          <div className="notepad-heading">
            <h2 className="label-maker">Interests</h2>
          </div>
          <ul className="paper"></ul>
        </section>

        <Doodles />
      </aside>
    </React.Fragment>
  );
};

export default Aside;
